            Process.Start("https://github.com/green1052/dosTool");
        }

        private void checkBox3_CheckedChanged(object sender, EventArgs e)
        {
            _stealth = checkBox3.Checked;
        }

        private void Form1_Load(object sender, EventArgs e)
